(7, 'Trang chủ', '6', 0, '<div><span class=\"text-dark\" data-original-title=\"\" title=\"\" style=\"\" source=\"\" sans=\"\" pro\",=\"\" -apple-system,=\"\" blinkmacsystemfont,=\"\" \"segoe=\"\" ui\",=\"\" roboto,=\"\" \"helvetica=\"\" neue\",=\"\" arial,=\"\" sans-serif,=\"\" \"apple=\"\" color=\"\" emoji\",=\"\" ui=\"\" symbol\";=\"\" text-align:=\"\" center;\"=\"\"><div data-original-title=\"\" title=\"\" style=\"text-align: center;\">Cộng hòa xã hội chủ nghĩa Việt Nam</div><div data-original-title=\"\" title=\"\" style=\"text-align: center;\">Độc lập - Tự do - Hạnh phúc</div></span><span style=\"\" source=\"\" sans=\"\" pro\",=\"\" -apple-system,=\"\" blinkmacsystemfont,=\"\" \"segoe=\"\" ui\",=\"\" roboto,=\"\" \"helvetica=\"\" neue\",=\"\" arial,=\"\" sans-serif,=\"\" \"apple=\"\" color=\"\" emoji\",=\"\" ui=\"\" symbol\";=\"\" text-align:=\"\" center;\"=\"\"><div style=\"text-align: center;\"><font color=\"#953734\"><br></font></div></span><h6 data-original-title=\"\" title=\"\" style=\"text-align: center; \" source=\"\" sans=\"\" pro\",=\"\" -apple-system,=\"\" blinkmacsystemfont,=\"\" \"segoe=\"\" ui\",=\"\" roboto,=\"\" \"helvetica=\"\" neue\",=\"\" arial,=\"\" sans-serif,=\"\" \"apple=\"\" color=\"\" emoji\",=\"\" ui=\"\" symbol\";=\"\" color:=\"\" rgb(220,=\"\" 53,=\"\" 69);=\"\" text-align:=\"\" center;\"=\"\"><font color=\"#953734\">GIA PHẢ TỘC NGUYỄN</font></h6><h4 data-original-title=\"\" title=\"\" style=\"text-align: center; \" source=\"\" sans=\"\" pro\",=\"\" -apple-system,=\"\" blinkmacsystemfont,=\"\" \"segoe=\"\" ui\",=\"\" roboto,=\"\" \"helvetica=\"\" neue\",=\"\" arial,=\"\" sans-serif,=\"\" \"apple=\"\" color=\"\" emoji\",=\"\" ui=\"\" symbol\";=\"\" color:=\"\" rgb(220,=\"\" 53,=\"\" 69);=\"\" text-align:=\"\" center;\"=\"\"><font color=\"#953734\">THỦY TỔ NGUYỄN VĂN CỐT</font></h4><div style=\"text-align: center;\"><font color=\"#953734\">(TỈNH QUẢNG NAM)</font></div><div style=\"text-align: center;\"><font color=\"#953734\"><br></font></div><div style=\"text-align: center;\"><font color=\"#953734\"><br></font></div><h5 data-original-title=\"\" title=\"\" style=\"text-align: center; \" source=\"\" sans=\"\" pro\",=\"\" -apple-system,=\"\" blinkmacsystemfont,=\"\" \"segoe=\"\" ui\",=\"\" roboto,=\"\" \"helvetica=\"\" neue\",=\"\" arial,=\"\" sans-serif,=\"\" \"apple=\"\" color=\"\" emoji\",=\"\" ui=\"\" symbol\";=\"\" color:=\"\" rgb(220,=\"\" 53,=\"\" 69);=\"\" text-align:=\"\" center;\"=\"\"><font color=\"#953734\">NGUYỄN VĂN PHÚ THUẬN LÀNG PHONG PHÚ, HUYỆN QUẾ SƠN;&nbsp;</font></h5><h5 data-original-title=\"\" title=\"\" style=\"text-align: center; \" source=\"\" sans=\"\" pro\",=\"\" -apple-system,=\"\" blinkmacsystemfont,=\"\" \"segoe=\"\" ui\",=\"\" roboto,=\"\" \"helvetica=\"\" neue\",=\"\" arial,=\"\" sans-serif,=\"\" \"apple=\"\" color=\"\" emoji\",=\"\" ui=\"\" symbol\";=\"\" color:=\"\" rgb(220,=\"\" 53,=\"\" 69);=\"\" text-align:=\"\" center;\"=\"\"><font color=\"#953734\">CHI PHÁI NGUYỄN TRƯỜNG THÔN VIỆT SƠN, XÃ BÌNH TRỊ, HUYỆN THĂNG BÌNH&nbsp;</font></h5><h5 data-original-title=\"\" title=\"\" style=\"text-align: center; \" source=\"\" sans=\"\" pro\",=\"\" -apple-system,=\"\" blinkmacsystemfont,=\"\" \"segoe=\"\" ui\",=\"\" roboto,=\"\" \"helvetica=\"\" neue\",=\"\" arial,=\"\" sans-serif,=\"\" \"apple=\"\" color=\"\" emoji\",=\"\" ui=\"\" symbol\";=\"\" color:=\"\" rgb(220,=\"\" 53,=\"\" 69);=\"\" text-align:=\"\" center;\"=\"\"><font color=\"#953734\">VÀ CHI PHÁI NGUYỄN TRƯỜNG XỨ A ĐÔNG, LÀNG PHÚ NHUẬN, XÃ HUY HÒA, HUYỆN DUY XUYÊN</font></h5></div>', '2019-04-22 15:20:12', '2019-04-25 16:00:35'),
(8, 'Phả ký', '7', 0, '<div><div data-original-title=\"\" title=\"\" style=\"color: rgb(33, 37, 41); font-family: \" source=\"\" sans=\"\" pro\",=\"\" -apple-system,=\"\" blinkmacsystemfont,=\"\" \"segoe=\"\" ui\",=\"\" roboto,=\"\" \"helvetica=\"\" neue\",=\"\" arial,=\"\" sans-serif,=\"\" \"apple=\"\" color=\"\" emoji\",=\"\" ui=\"\" symbol\";\"=\"\"><div style=\"text-align: center;\"><div data-original-title=\"\" title=\"\" source=\"\" sans=\"\" pro\",=\"\" -apple-system,=\"\" blinkmacsystemfont,=\"\" \"segoe=\"\" ui\",=\"\" roboto,=\"\" \"helvetica=\"\" neue\",=\"\" arial,=\"\" sans-serif,=\"\" \"apple=\"\" color=\"\" emoji\",=\"\" ui=\"\" symbol\";\"=\"\" style=\"text-align: left;\"><div style=\"text-align: center;\"><em data-original-title=\"\" title=\"\" style=\"font-size: 1rem;\">\"Kể từ đất Bắc hoang châu</em></div><em data-original-title=\"\" title=\"\"><div style=\"text-align: center;\"><em data-original-title=\"\" title=\"\" style=\"font-size: 1rem;\">Đổ xuân hai chữ cơ đồ tiền nhân</em></div><div style=\"text-align: center;\"><em data-original-title=\"\" title=\"\" style=\"font-size: 1rem;\">Kỳ Ba Nghệ Tĩnh hương lân</em></div><div style=\"text-align: center;\"><em data-original-title=\"\" title=\"\" style=\"font-size: 1rem;\">Chôn nhau cắt rốn tri ân đời đời.\"</em></div><div style=\"text-align: center;\"><em data-original-title=\"\" title=\"\" style=\"font-size: 1rem;\"><br></em></div></em></div><div class=\"content\" data-original-title=\"\" title=\"\" source=\"\" sans=\"\" pro\",=\"\" -apple-system,=\"\" blinkmacsystemfont,=\"\" \"segoe=\"\" ui\",=\"\" roboto,=\"\" \"helvetica=\"\" neue\",=\"\" arial,=\"\" sans-serif,=\"\" \"apple=\"\" color=\"\" emoji\",=\"\" ui=\"\" symbol\";\"=\"\" style=\"text-align: left;\"><div data-original-title=\"\" title=\"\" style=\"text-indent: 20px; text-align: justify;\">Tổ tiên ta ngày xưa ở thôn Xuân Chữ, xã Đỗ Chữ, huyện Kỳ Ba, tổng Thừa Tuyên, phủ Hà Ba, tỉnh Nghệ An, vào ở tỉnh Quảng Nam, phủ Thăng Bình, huyện Quế Sơn, tổng Xuân Phú nay là xã Quế Thuận, huyện Quế Sơn khai cơ lập nghiệp.</div><div data-original-title=\"\" title=\"\" style=\"text-indent: 20px; text-align: justify;\">Năm 1996 ngày 22 tháng 7, con cháu hệ 12 xem lại bản đồ các tỉnh, thì nhận thấy quê hương ông bà ta nay không phải ở tỉnh Nghệ An, mà ở tỉnh Hà Tĩnh, vì theo biến đổi của từng thời kỳ kinh tế, xã hội mà tên tỉnh ngày xưa đã nhiều lần thay đổi, đến ngày nay được biết rõ quê hương ông bà ta ở tỉnh Hà Tĩnh. Tên Xuân Chữ xưa vẫn còn, là xã Kỳ Hoa, huyện Kỳ Anh. Thôn Xuân Chữ là cửa khẩu của tỉnh, cách thị xã Kỳ Anh theo tỷ lệ xích bản đồ khoảng bảy cây số ngàn.</div><div data-original-title=\"\" title=\"\" style=\"text-indent: 20px; text-align: justify;\"><br></div><div data-original-title=\"\" title=\"\" style=\"text-indent: 20px; text-align: justify;\">Vào năm Mậu Ngọ 1558, Đoàn Quận Công Nguyễn Hoàng, con thứ hai của Nguyễn Kim, được vua Lê Anh Tông cho vào trấn thủ Thuận Hóa, giữa khoảng cuối đời Lê - đầu nhà Mạc, đất Thuận Hóa lúc bấy giờ có loạn thổ hào quấy nhiễu cướp phá, dân chúng nghèo nàn đói khổ, theo đà Nam tiến, đành bỏ quê hương xứ sở vào đất Quảng Nam, đến huyện Quế Sơn, khai phá làm ăn, xây dựng cơ nghiệp tại làng Phong Đăng ngày xưa, tức là làng Phong Phú, thuộc xã Quế Thuận, huyện Quế Sơn ngày nay.</div><div data-original-title=\"\" title=\"\" style=\"text-indent: 20px; text-align: justify;\">Tổ tiên ta trước là Nguyễn Văn, đến đời thứ 6 mới phân ra thành hai phái: Nguyễn Trường và Nguyễn Văn. Ông bà ta lâu đời sợ con cháu không hiểu sự phân chia thành hai tộc mới đề văn bản có câu: \"<span style=\"font-weight: bolder;\">Trường - Văn nhị phái, lưỡng năng song cáng, nhất khí tương thừa</span>\", nghĩa là Trường - Văn hai phái, sanh ra hai gốc lớn, nhưng cùng chung một cội rễ, ta cùng thờ chung một ông bà tiên tổ.</div><div data-original-title=\"\" title=\"\" style=\"text-indent: 20px; text-align: justify;\"><br></div><div data-original-title=\"\" title=\"\" style=\"text-indent: 20px; text-align: justify;\">Trong thời kỳ chống Pháp và chống Mỹ xâm lăng, tộc ta cũng có các sĩ quan, tướng tá, anh hùng quân đội, binh sĩ đã anh dũng chiến đấu với quân thù, giành độc lập cho Tổ quốc, nay có kẻ còn người mất.</div><div data-original-title=\"\" title=\"\" style=\"text-indent: 20px; text-align: justify;\">Những người học giỏi thành giáo sư, tiến sĩ, kỹ sư, bác sĩ, cử nhân,... cùng đem tài năng, sức lực ra xây dựng đất nước, có người xuất dương du học ở các nước như Anh, Mỹ, Liên Xô, Pháp, Đức, Nhật,...</div><div data-original-title=\"\" title=\"\" style=\"text-indent: 20px; text-align: justify;\"><br></div><div data-original-title=\"\" title=\"\" style=\"text-indent: 20px; text-align: justify;\">Năm Giáp Mùi 1823, thời vua Minh Mạng thứ tư, hệ thống gia tộc mới bắt đầu hình thành, Từ đường bắt đầu xây dựng, tôn đồ được củng cố và ghi chép lại, nhưng vẫn còn thiếu sót hoặc bị mất gốc nên con cháu ngày này có người không biết tên tuổi ông bà, hoặc thứ lớp nào, ai anh, ai em, tuy cũng biết cùng con cháu ông Nguyễn Văn Nhiều sinh ra.</div><div data-original-title=\"\" title=\"\" style=\"text-indent: 20px; text-align: justify;\">Ngày 18.6.1981 nhằm ngày 17.5 Tân Dậu, các chi phái trong tộc họp lại lần thứ nhất tại Từ đường Quế Sơn ở Phong Phú để thống nhất làm lại Phổ hệ, lần thứ hai ngày 20.8 Bính Tý (1996) và lần thứ ba cũng tại nơi này. Vào tháng 3 Đinh Sửu (1997) việc trùng tu lần này, chúng tôi cố gắng đem hết năng lực phục vụ tương đối đầy đủ hơn trước, nhưng cũng không khỏi thiếu sót hoặc nhầm lẫn.</div><div data-original-title=\"\" title=\"\" style=\"text-indent: 20px; text-align: justify;\">Tộc Nguyễn ta đến nay sinh trưởng được 17 đời, ở khắp các xã của huyện. Tộc chính ở Quế Sơn thuộc làng Phong Phú, một diễn phái ở A Đông Phú Nhuận, Thanh Châu, Phú Lạc, Cù Bàn, La Tháp thuộc xã mới Duy Hòa, huyện Duy Xuyên; An Bằng ở Đại Lộc, Lộc Sơn, Thăng Bình; Lễ Dương ở Tiên Phước; Đồng Xuân ở Phú Yên; các thành phố lớn như Đà Nẵng, Sài Gòn và đến nay ở rải rác khắp mọi miền đất nước, hoặc du học và định cư ở nước ngoài,...</div><div data-original-title=\"\" title=\"\" style=\"text-indent: 20px; text-align: justify;\"><br></div><div data-original-title=\"\" title=\"\" style=\"text-indent: 20px; text-align: justify;\">Lúc mới đến đất đai hoàn toàn gò hoang cỏ dại, cây cối chen chúc với găng cây gai gốc, nên ông bà ta đặt tên là xứ \"Đồng Găng\".</div><div data-original-title=\"\" title=\"\" style=\"text-indent: 20px; text-align: justify;\">Tộc Nguyễn ta lúc đầu chỉ có ông cha là&nbsp;<a href=\"https://nguyenvantoc.000webhostapp.com/map?view=1\" target=\"_self\">Nguyễn Văn Cốt</a>, ông con là&nbsp;<a href=\"https://nguyenvantoc.000webhostapp.com/map?view=2\" target=\"_self\">Nguyễn Văn Nhiều</a>&nbsp;và bà dâu là&nbsp;<a href=\"https://nguyenvantoc.000webhostapp.com/map?view=28\" target=\"_self\">Nguyễn Thị Thanh</a>, theo cùng có người đồng hương là ông Lương Trường Thọ. Hai họ cùng chung lưng đấu cật, khai khẩn đất hoang mỗi ngày một rộng ra, con cháu càng ngày càng đông, các tộc khác dần dần tới càng nhiều, rồi từ đó lập ra xã Phong Đăng, dân chúng ở đây làm ăn giàu có, thịnh vượng, sau mới đổi tên là Phong Phú.</div><div data-original-title=\"\" title=\"\" style=\"text-indent: 20px; text-align: justify;\">Năm Giáp Tý 1744, đời Nguyễn Phúc Khoát xưng vương, mở mang triều chính, nới rộng diện tích đất canh tác để nâng cao đời sống. Thời điểm đó, 3 anh em trong họ là ông&nbsp;<a href=\"https://nguyenvantoc.000webhostapp.com/map?view=163\" target=\"_self\">Nguyễn Văn Công</a>&nbsp;con ông&nbsp;<a href=\"https://nguyenvantoc.000webhostapp.com/map?view=160\" target=\"_self\">Nguyễn Văn Liêm</a>; ông&nbsp;<a href=\"https://nguyenvantoc.000webhostapp.com/map?view=750\" target=\"_self\">Nguyễn Trường Trù</a>, ông&nbsp;<a href=\"https://nguyenvantoc.000webhostapp.com/map?view=1409\" target=\"_self\">Nguyễn Trường Túy</a>&nbsp;con ông&nbsp;<a href=\"https://nguyenvantoc.000webhostapp.com/map?view=6\" target=\"_self\">Nguyễn Văn Tường</a>, rời đất Quế Sơn ra ở xứ A Đông Phú Nhuận, Phú Lạc, Thanh Châu, Cù Bàn, La Tháp nay thuộc xã Duy Hòa, huyện Duy Xuyên làm ăn sinh sống.</div><div data-original-title=\"\" title=\"\" style=\"text-indent: 20px; text-align: justify;\"><br></div><div data-original-title=\"\" title=\"\" style=\"text-indent: 20px; text-align: justify;\">Thời gian tiếp tục trôi qua, Tộc ta đã trải qua bao nhiêu năm tháng thăng trầm sóng gió của xã hội, theo từng thời đại, đã sinh ra những danh nhân hào kiệt, cả văn nhân lẫn võ tướng.</div><div data-original-title=\"\" title=\"\" style=\"text-indent: 20px; text-align: justify;\">Về văn nho có Ấm Sanh, Bá Hộ, Chánh Thất, Bác Cửu Phẩm, người làm đề lại, người tú tài như ông Tú Truyện, danh nhân là&nbsp;<a href=\"https://nguyenvantoc.000webhostapp.com/map?view=2484\" target=\"_self\">Nguyễn Trường Luân</a>.</div><div data-original-title=\"\" title=\"\" style=\"text-indent: 20px; text-align: justify;\">Về võ thì có Đô đốc chỉ huy sứ&nbsp;<a href=\"https://nguyenvantoc.000webhostapp.com/map?view=71\" target=\"_self\">Nguyễn Trường Định</a>, anh dũng tướng quân&nbsp;<a href=\"https://nguyenvantoc.000webhostapp.com/map?view=823\" target=\"_self\">Nguyễn Trường Duyệt</a>, Phấn dũng tướng quân cấm binh phó vệ úy&nbsp;<a href=\"https://nguyenvantoc.000webhostapp.com/map?view=9\" target=\"_self\">Nguyễn Trường Đổng</a>, kinh thành đề đốc lãnh binh&nbsp;<a href=\"https://nguyenvantoc.000webhostapp.com/map?view=10\" target=\"_self\">Nguyễn Trường Nhiêu</a>, Minh nghĩa đô úy chánh tứ phẩm quảng cơ&nbsp;<a href=\"https://nguyenvantoc.000webhostapp.com/map?view=754\" target=\"_self\">Nguyễn Trường Chất</a>, chánh bác phẩm điễn ty&nbsp;<a href=\"https://nguyenvantoc.000webhostapp.com/map?view=1194\" target=\"_self\">Nguyễn Trường Sung</a>, quan Kỳ Xuất Đội,...</div><div data-original-title=\"\" title=\"\" style=\"text-indent: 20px; text-align: justify;\"><br></div><div data-original-title=\"\" title=\"\" style=\"text-indent: 20px; text-align: justify;\">Cây có cội, nước có nguồn, tất cả tên tuổi của Tổ sanh, các bậc tiền nhân tổ phụ của cha ông và của chúng ta xây thành một dòng máu Trường lưu vô tận, được tiếp nối đời này sang đời khác, muôn đời tưởng nhớ tri ân Tổ phụ.</div><div data-original-title=\"\" title=\"\" style=\"text-indent: 20px; text-align: justify;\">Về thờ phụng tổ tiên ở Quế Sơn có Từ đường tộc cả tại làng Phong Phú, cứ đến rằm tháng 3 hoặc tháng 8 âm lịch, con cháu nội ngoại tụ về đông đủ để mặc niệm, cúng tế tổ tiên, Xuân Thu 2 kỳ; ở Duy Xuyên có từ đường tại xứ A Đông, Phú Nhuận thuộc xã Duy Hòa, mỗi lần xuân đến, con cháu nội ngoại cùng về Từ đường ngày 10 tháng 2 âm lịch, tổ chức Tế xuân cho ông bà Tổ tiên như Tộc cả Quế Sơn.</div><div data-original-title=\"\" title=\"\" style=\"text-indent: 20px; text-align: justify;\"><br></div><div data-original-title=\"\" title=\"\" style=\"text-indent: 20px; text-align: justify;\">Hỡi con cháu của Gia Tộc, dù trai hay gái, xa hay gần, người trong nước hay ở ngoài nước, hãy đoàn kết yêu thương lẫn nhau mà hướng về cội nguồn, như các mạch máu trong cơ thể cùng chảy về tim, hãy đem hết tài năng trí tuệ, để đóng góp gìn giữ cơ đồ gia tộc, chung sức chung lòng xây dựng đất nước quê hương phú cường hưng thịnh.</div><div data-original-title=\"\" title=\"\" style=\"text-indent: 20px; text-align: justify;\"><em class=\"float-right\" data-original-title=\"\" title=\"\">Phong Phú, ngày 17 tháng 11 Đinh Sửu<br data-original-title=\"\" title=\"\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;(tức ngày 16 tháng 12 năm 1997)</em></div><br data-original-title=\"\" title=\"\"><br data-original-title=\"\" title=\"\"><br data-original-title=\"\" title=\"\"><div data-original-title=\"\" title=\"\" style=\"text-indent: 20px; text-align: justify;\"><span data-original-title=\"\" title=\"\" style=\"font-weight: bolder;\">Ban biên tập và soạn giả:</span><br data-original-title=\"\" title=\"\">-&nbsp;<a href=\"https://nguyenvantoc.000webhostapp.com/map?view=12\" target=\"_self\">Nguyễn Trường Tứ</a>&nbsp;(hệ 12)<br data-original-title=\"\" title=\"\">-&nbsp;<a href=\"https://nguyenvantoc.000webhostapp.com/map?view=3116\" target=\"_self\">Nguyễn Trường Ngọc Tuân</a>&nbsp;(hệ 12)<br data-original-title=\"\" title=\"\">-&nbsp;<a href=\"https://nguyenvantoc.000webhostapp.com/map?view=3593\" target=\"_self\">Nguyễn Văn Sử</a>&nbsp;(hệ 15)<br data-original-title=\"\" title=\"\">-&nbsp;<a href=\"https://nguyenvantoc.000webhostapp.com/map?view=13\" target=\"_self\">Nguyễn Trường Hiệp</a>&nbsp;(hệ 13)</div><div data-original-title=\"\" title=\"\" style=\"text-indent: 20px; text-align: justify;\"><span data-original-title=\"\" title=\"\" style=\"font-weight: bolder;\">Vi tính và ấn loát:</span><br data-original-title=\"\" title=\"\">-<a href=\"https://nguyenvantoc.000webhostapp.com/map?view=2725\" target=\"_self\">&nbsp;Nguyễn Trường Hoàng</a>&nbsp;(hệ 13)<br data-original-title=\"\" title=\"\">-&nbsp;<a href=\"https://nguyenvantoc.000webhostapp.com/map?view=2735\" target=\"_self\">Nguyễn Trường Ấn</a>&nbsp;(hệ 14)</div><div data-original-title=\"\" title=\"\" style=\"text-indent: 20px; text-align: justify;\"><span style=\"font-weight: 700;\">Số hóa</span>&nbsp;(01/05/2019)<span style=\"font-weight: 700;\">:</span><br data-original-title=\"\" title=\"\">-&nbsp;<a href=\"https://nguyenvantoc.000webhostapp.com/map?view=15\" target=\"_self\">Nguyễn Trường Thọ</a>&nbsp;(hệ 14)</div></div></div></div></div>', '2019-04-22 15:20:12', '2019-04-25 15:56:25'),
